import React from 'react';
import s from './Home.module.css';

class SocialIcon extends React.Component {

    state = [
        tik = { src: 'https://media-exp3.licdn.com/dms/image/C4D0BAQGLfq8Bk-kzpQ/company-logo_200_200/0/1617004562323?e=2159024400&v=beta&t=d3eGWh5k4OldpC3R_7QPEyZ1druE3rzn4UwTXb9FONc' }
    ]


    render() {
        debugger;
        return (
            <div className={s.body}>
                <a href="#"><img src={this.state.tik} alt={'na xer'} /></a>
            </div>
        );
    }
}

export default SocialIcon;
